taskSetItem.script2:
var token = eio.readString8();
var regDate = eio.readString8();

var sql,sqlResult;
sql = "exec getUserInfoBySession '" + db.encode(token) + "'";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString8("token失效");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId");

sql= 
    "SELECT * " +
    "  FROM [TCloud].[dbo].[order] " +
    "  where regDate = '" + db.encode(regDate) + "' and status = 'NEW' and companyId = " + companyId + " " +
    "  order by regdatetime ";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
eio.appendString8("T");
eio.appendDataSet(sqlResult,"id,address,address1,address2,address3,mobile,name,orderCount,note,regDatetime", 0, 10);

