taskSetItem.script2:
var token = eio.readString8();
//var searchText = eio.readString8();
var pageSize = eio.readInt32();
var pageCurrent = eio.readInt32();

var sql,sqlResult;
sql = "exec getUserInfoBySession '" + db.encode(token) + "'";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString8("token失效");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId");

//获取记录数量
sql =
    "SELECT count(*) as c " +
    "FROM (SELECT TOP (100) PERCENT regDate,  " +
    "              SUM(CASE WHEN [status] = 'NEW' THEN 1 ELSE 0 END) AS new,  " +
    "              SUM(CASE WHEN [status] = 'CHK' THEN 1 ELSE 0 END) AS chk,  " +
    "              SUM(CASE WHEN [status] = 'FAL' THEN 1 ELSE 0 END) AS fal,  " +
    "              SUM(CASE WHEN [status] = 'EP1' THEN 1 ELSE 0 END) AS ep1,  " +
    "              SUM(CASE WHEN [status] = 'EP2' THEN 1 ELSE 0 END) AS ep2,  " +
    "              SUM(CASE WHEN [status] = 'SND' THEN 1 ELSE 0 END) AS snd " +
    "        FROM dbo.[order] " +
    "        WHERE (companyId = " + companyId + ") " +
    "        GROUP BY regDate) AS t1   " +
    "WHERE (new > 0) ";
sqlResult = db.executeQuery("DB", sql);   
db.read(sqlResult);
var count = db.getInt32(sqlResult, "c");

sql= 
    "SELECT TOP (100) PERCENT regDate, new, chk, fal, ep1, ep2, snd " +
    "FROM (SELECT TOP (100) PERCENT regDate,  " +
    "              SUM(CASE WHEN [status] = 'NEW' THEN 1 ELSE 0 END) AS new,  " +
    "              SUM(CASE WHEN [status] = 'CHK' THEN 1 ELSE 0 END) AS chk,  " +
    "              SUM(CASE WHEN [status] = 'FAL' THEN 1 ELSE 0 END) AS fal,  " +
    "              SUM(CASE WHEN [status] = 'EP1' THEN 1 ELSE 0 END) AS ep1,  " +
    "              SUM(CASE WHEN [status] = 'EP2' THEN 1 ELSE 0 END) AS ep2,  " +
    "              SUM(CASE WHEN [status] = 'SND' THEN 1 ELSE 0 END) AS snd " +
    "        FROM dbo.[order] " +
    "        WHERE (companyId = " + companyId + ") " +
    "        GROUP BY regDate) AS t1 " +
    "WHERE (new > 0) " +
    "ORDER BY regDate DESC ";

sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
eio.appendString8("T");
eio.appendInt32(count);
eio.appendDataSet(sqlResult,"regDate,new,chk,fal,ep1,ep2,snd", pageSize*(pageCurrent-1), pageSize);

